import {NavLink, Router} from "react-router-dom";
import {React, useState} from 'react';

export const Home = () => {
  //const [projects, setProjects] = useState([]);

  return (
    <div className="body">

      <Navigation />

      <div className="content">
        <SearchBar />
        <div className="projects">
            {/*projects.map((item) => {
              return (
