              )
            })*/}
          <div className = "item">
            <ProjectTile/>
          </div> 
          <div className = "item">
            <ProjectTile/>
          </div> 
          <div className = "item">
            <ProjectTile/>
          </div> 
          
        </div>
      </div>
      <div className='new-project'>
            <NewProject />
      </div>
    </div>
  );
}
